import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Signup from './pages/signup';
import ErrorBoundary from './ErrorBoundary';

function App() {
  return (
    <ErrorBoundary>
      <Router>
        <div className="App">
          <Routes>

            <Route path="/signup" element={<Signup />} />

          </Routes>
        </div>
      </Router>
    </ErrorBoundary>
  );
}

export default App;
